  \"Aromatic Thermosetting Copolyesters for Ablative TPS Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T21:19:39.806312\",\n\t\"name\": \"aromatic-thermosetting-copolyesters-for-ablative-tps-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Better performing ablative thermal protection
  systems than currently available are needed to satisfy requirements of the most
  severe crew exploration vehicles, such as the Mars Sample Return with 12-15 km/s
  Earth entry.  The primary objective of CU Aerospace's Phase I work will be to fabricate
  and test aromatic thermosetting copolyesters (ATSP) composites for use as ablatives
  in next generation spacecraft missions. The synthetic development of novel aromatic
  thermosetting copolyesters was a major innovation in the field of polymer science.
  Previous testing of their capabilities showed excellent performance as adhesives,
  rigid foams, matrices for composites, and dielectrics for microelectronics.  Only
  recently has this material been considered as a viable ablative due to its high
  temperature stability and excellent composite mechanical properties especially due
  to the liquid crystalline nature of the polymer, which allows a matching of CTE
  between fiber and matrix. Our team partner the University of Illinois at Urbana-Champaign
  will assist CU Aerospace to perform basic research and provide technical support
  to accelerate the transition of ATSP polymers into ablative composites. If successful
  CU Aerospace envisions the ATSP to be utilized in a wide variety of applications
  in both civilian and military spacecraft, either as a retrofit or as a next-generation
  design.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
